import { Link } from "react-router-dom";

const ArtistsHome = () => {
    return (
      <>
        <h1 className="text-white">Page Home</h1>

        <Link to={`/artists`}>
        <p className="text-white">Accéder à la liste des artistes</p>
        </Link>
        <Link to={`/albums`}>
        <p className="text-white">Accéder à la liste des albums</p>
        </Link>
      </>
    );
  };

  export default ArtistsHome;
